-- ----------------------------
-- Table structure for sys_user_org
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_org`;
CREATE TABLE `sys_user_org`  (
  `user_org_id` bigint(20) NOT NULL COMMENT '企业员工主键id',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
